Very HQ rare promo music video which includes a second audio track with commentary from both artists. &quot;West End Girls&quot; is a song bypop duo Pet Shop Boys. Written by Neil Tennant and Chris Lowe, the song was released twice as a single. It is a synthpop song, influenced by hip hop music. The lyrics focus on class, and inner-city pressure, and were inspired by T.S. Eliot's poem The Waste Land. It was generally well received by contemporary music critics and has been frequently cited as a highlight in the duo's career.

The first version of the song was produced by Bobby Orlando and was released in April 1984, becoming a club hit in the United States and some European countries. After the duo signed with EMI, the song was re-recorded with producer Stephen Hague, for their first studio album, Please. In late 1985, the song was re-released, reaching number one in the United Kingdom and the United States in 1986. In 1987, the song won for Best Single at TheAwards, and Best International Hit at the Ivor Novello Awards. In 2005, 20 years later after its release, the song was awarded Song of The Decade between the years 1985 and 1994, by theAcademy of Composers and Songwriters.
